import React, { Component } from "react";
import "./results.css";

class Results extends Component {
  constructor(props) {
    super(props);
    this.state = {
      status: "",
    };
  }

  render() {
    return <div className="container">{this.getMessage}</div>;
  }
}

export default Results;
